.input-find-content {
  width: 200px;
  height: 28px;
  line-height: 28px;
  position: relative;
  border-radius: 2px;
  overflow: hidden;
  border-width: 1px;
  border-style: solid;
  box-sizing: border-box;
  transition: all 0.3s;
  .clones {
    position: absolute;
    right: 10px;
    line-height: 28px;
    cursor: pointer;
  }
  .solidBc {
    position: absolute;
    width: 100%;
    height: 100%;
    left: 0;
    top: 0;
  }
  .content {
    z-index: 2;
    position: absolute;
    width: 100%;
    height: 100%;
    left: 0;
    top: 0;
  }
  .solidBc-hover {
    opacity: 0.05
  }
  .solidBc-active {
    opacity: 0.05
  }
  .iconbox {
    width: 30px;
    height: 28px;
    display: inline-block;
    text-align: center;
    line-height: 28px;
    vertical-align: middle
  }
  input {
    width: 168px;
    height: 20px;
    margin-top: -1px;
    line-height: 20px;
    vertical-align: middle
  }
}
